import sys
from collections import deque

class Solution:
    def __init__(self) -> None:
        self.stack = deque()

    def read(self) -> str:
        return sys.stdin.readline().strip()

    def read_int(self) -> int:
        return int(self.read())

    def read_int_arr(self) -> list[int]:
        return [self.read_int() for _ in range(self.read_int())]

    def read_int_arr_2d(self) -> list[list[int]]:
        return [self.read_int_arr() for _ in range(self.read_int())]

    def read_int_arr_3d(self) -> list[list[list[int]]]:
        return [self.read_int_arr_2d() for _ in range(self.read_int())]

    def read_int_arr_4d(self) -> list[list[list[list[int]]]]:
        return [self.read_int_arr_3d() for _ in range(self.read_int())]

    def solve_helper(self, n: int, q: int) -> None:
        nums = self.read_int_arr_2d()
        nums.sort()
        for _ in range(q):
            nums, current_number = self.solve(nums, self.read_int())
            print(current_number)

    def solve(self, nums: list[list[int]], n: int) -> list[list[int]]:
        current_number = -1
        for row in nums:
            if row[0] == n:
                return [row], row[0]
            if row[0] > n:
                return [row], row[0]
            if row[0] <= n:
                if row[0] == current_number:
                    return [row], row[0]
                current_number = row[0]
        return nums, current_number

